changes.value:
({
  step,
  title,
  disabled,
  isComplete
}: Pick<EuiStepHorizontalProps, 'step' | 'title' | 'disabled' | 'isComplete'>) => {
  let titleAppendix = '';

  if (disabled) {
    titleAppendix = ' is disabled';
  } else if (isComplete) {
    titleAppendix = ' is complete';
  }

  return `Step ${step}: ${title}${titleAppendix}`;
};

({
  status
}: {
  status?: EuiStepStatus;
}) => {
  if (status === 'incomplete') return 'Incomplete Step';
  return 'Step';
};

